import React from 'react';
import './Header.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const Header = props =>{
   return (
      <div className="head">
         <img id="logo" src={require("../images/logo.png")}/>
         <h1 id="title"> INFORM </h1>

         <ul className="nav">
            <li className="nav-item">
               About Us
            </li>
            <li className="nav-item">
               Add Story
            </li>
         </ul>
      </div>
   );
}

export default Header;
